INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2014-11-25 23:25:20', '2014-11-25 23:25:21', 1),
(2, 'Footer Links Company', 'footer_links_company', '<div class="col-sm-4">\r\n<div class="links">\r\n<div class="block-title"><strong><span>Information</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}"> <i class="icon icon-facebook"></i> Follow us un facebook</a></li>\r\n<li><a href="{{store url=""}}"> <i class="icon icon-twitter"></i> Follow us on twitter</a></li>\r\n<li><a href="{{store url=""}}"> <i class="icon icon-linkedin-square"></i> Follow us on linkedin</a></li>\r\n<li><a href="{{store url=""}}"> <i class="icon icon-rss"></i> RSS feeds</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="links">\r\n<div class="block-title"><strong><span>Links</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\r\n<li><a href="{{store url=""}}">Terms of Use</a></li>\r\n<li><a href="{{store url=""}}">Club Info and FAQ''s</a></li>\r\n<li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\r\n<li><a href="{{store url=""}}contacts/">Contact us</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="links">\r\n<div class="block-title"><strong><span>Customer Service</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}">Ask in forum</a></li>\r\n<li><a href="{{store url=""}}">Help Desk</a></li>\r\n<li><a href="{{store url=""}}">Payment Method</a></li>\r\n<li><a href="{{store url=""}}">Custom Work</a></li>\r\n<li><a href="{{store url=""}}">Promotions</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="links">\r\n<div class="block-title"><strong><span>My Account</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}">Login</a></li>\r\n<li><a href="{{store url=""}}">View Cart</a></li>\r\n<li><a href="{{store url=""}}">Wishlist</a></li>\r\n<li><a href="{{store url=""}}">Check out</a></li>\r\n<li><a href="{{store url=""}}">Track My Order</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-sm-8">\r\n<div class="links">\r\n<div class="block-title"><strong><span>Contact Us</span></strong></div>\r\n<ul class="last-list">\r\n<li><i class="icon icon-map-marker"></i> Address: No 40 Baria Sreet 133/2 Chandigarh City, Chandigarh</li>\r\n<li><i class="icon icon-envelope"></i> <a href="mailto:support@santushti.com">Email: support@santushti.com</a></li>\r\n<li><i class="icon icon-mobile"></i> Phone1: 0123456789<br /> Phone2: 0123456789</li>\r\n</ul>\r\n</div>\r\n</div>', '2014-11-25 23:25:21', '2014-12-05 06:06:37', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-11-25 23:25:21', '2014-11-25 23:25:21', 1),
(4, 'Home-slider', 'Home-Slider', '<div class="slideshow-container">\r\n<ul class="slideshow">\r\n<li><a href="linkhere"><img alt="" src="{{media url="wysiwyg/banner/banner_1.jpg"}}" /></a></li>\r\n<li><a href="linkhere"><img alt="" src="{{media url="wysiwyg/banner/banner_2.jpg"}}" /></a></li>\r\n<li><a href="linkhere"><img alt="" src="{{media url="wysiwyg/banner/banner_3.jpg"}}" /></a></li>\r\n<li><a href="linkhere"><img alt="" src="{{media url="wysiwyg/banner/banner_4.jpg"}}" /></a></li>\r\n<li><a href="linkhere"><img alt="" src="{{media url="wysiwyg/banner/banner_5.jpg"}}" /></a></li>\r\n</ul>\r\n<div class="slideshow-pager">&nbsp;</div>\r\n</div>', '2014-11-26 05:10:38', '2014-11-26 05:10:49', 1),
(5, 'Display Recently View Products', 'recent_view_product', '<p>{{widget type="reports/product_widget_viewed" page_size="4" template="reports/widget/viewed/content/viewed_grid.phtml"}}</p>', '2014-11-26 05:12:31', '2014-12-03 02:26:18', 1),
(6, 'New Arrival Product', 'new_arrival_product', '<p>{{widget type="catalog/product_widget_new" display_type="all_products" products_count="8" template="catalog/product/widget/new/content/new_grid.phtml"}}</p>', '2014-11-26 05:15:23', '2014-11-26 07:19:24', 1),
(7, 'Newsletter', 'news-letter', '<p>{{block type="newsletter/subscribe" name="footer.newsletter" as="newsletter" template="newsletter/subscribe.phtml"}}</p>', '2014-11-27 07:03:36', '2014-11-27 07:03:42', 1),
(8, 'Home-Banner', 'home_banner', '<div id="home-banner">\r\n<div class="container">\r\n<div class="row">\r\n<div class="clearfix bannertopsection">\r\n<div class="col-sm-4">\r\n<p>BE UNIQUE, DRESSING UNIQUE</p>\r\n<h2>NEW ARRIVALS</h2>\r\n<a class="btn-effect" href="#"><span data-hover="SHOP NOW">SHOP NOW</span></a></div>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="banner-col">\r\n<h1>Custom Design</h1>\r\n<p>Our Designers are Waiting for You</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="banner-col">\r\n<h1>be unique</h1>\r\n<p>Choose Your Desired Dress</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="banner-col">\r\n<h1>Fitable We</h1>\r\n<p>We Design For Your Mesuares</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p><img class="homebanner" alt="" src="{{media url="wysiwyg/banner/banner.jpg"}}" /></p>\r\n</div>', '2014-11-29 05:40:20', '2014-12-05 06:02:40', 1),
(9, 'Footer Left Text', 'foooter-left-text', '<p style="text-align: justify;"><span class="message_content">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</span></p>\r\n<p style="text-align: justify;"><span class="message_content"> Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. </span></p>\r\n<p>&nbsp;</p>', '2014-12-01 03:50:23', '2014-12-04 00:33:02', 1),
(10, 'Home Deals Of Day 1-Col', 'home_deals_of_day_1_col', '<a href="#" ><img src="{{media url="wysiwyg/home_images/free1.jpg"}}" alt="" /> </a>', '2014-12-01 06:35:55', '2014-12-04 00:17:01', 1),
(11, 'Home Deals Of Day 2-Col', 'home_deals_of_day_2_col', '<a href="#" > <img src="{{media url="wysiwyg/home_images/free2.jpg"}}" alt="" /></a>', '2014-12-01 06:59:05', '2014-12-04 00:17:45', 1);
